import React from 'react';
import clsx from 'clsx';
import { makeStyles, useTheme } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import ChevronLeftIcon from '@material-ui/icons/ChevronLeft';
import ChevronRightIcon from '@material-ui/icons/ChevronRight';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import MailIcon from '@material-ui/icons/Mail';

import { Switch, Route, Redirect } from "react-router-dom";
import routes from "../../routes";

//navBar
import NavbarLinks from "../../components/Navbars/AdminNavbarLinks";
import classNames from "classnames";
import Icon from "@material-ui/core/Icon";
import { NavLink } from "react-router-dom";

function activeRoute(routeName) {
    return window.location.href.indexOf(routeName) > -1 ? true : false;
}

const { logo, logoText, image, handleDrawerToggle, open, color } = props;


const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
    root: {
        display: 'inline',
    },
    appBar: {
        zIndex: theme.zIndex.drawer + 1,
        transition: theme.transitions.create(['width', 'margin'], {
            easing: theme.transitions.easing.sharp,
            duration: theme.transitions.duration.leavingScreen,
        }),
        flexFlow: 'row nowrap',
        justifyContent: 'space-between',
    },
    appBarShift: {
        marginLeft: drawerWidth,
        width: `calc(100% - ${drawerWidth}px)`,
        transition: theme.transitions.create(['width', 'margin'], {
            easing: theme.transitions.easing.sharp,
            duration: theme.transitions.duration.enteringScreen,
        }),
    },
    menuButton: {
        marginRight: 36,
    },
    hide: {
        display: 'none',
    },
    drawer: {
        width: drawerWidth,
        flexShrink: 0,
        whiteSpace: 'nowrap',
    },
    drawerOpen: {
        width: drawerWidth,
        transition: theme.transitions.create('width', {
            easing: theme.transitions.easing.sharp,
            duration: theme.transitions.duration.enteringScreen,
        }),
    },
    drawerClose: {
        transition: theme.transitions.create('width', {
            easing: theme.transitions.easing.sharp,
            duration: theme.transitions.duration.leavingScreen,
        }),
        overflowX: 'hidden',
        width: theme.spacing(7) + 1,
        [theme.breakpoints.up('sm')]: {
            width: theme.spacing(9) + 1,
        },
    },
    toolbar: {
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'flex-end',
        padding: theme.spacing(0, 1),
        // necessary for content to be below app bar
        ...theme.mixins.toolbar,
    },
    content: {
        flexGrow: 1,
        paddingLeft: 100,
        paddingRight: 50,
    },
}));

const getRoute = () => {
    return window.location.pathname !== "/admin/maps";
};

const switchRoutes = (
    <Switch>
        {routes.map((prop, key) => {
            if (prop.layout === "/admin2") {
                return (
                    <Route
                        path={prop.layout + prop.path}
                        component={prop.component}
                        key={key}
                    />
                );
            }
            return null;
        })}
        <Redirect from="/admin2" to="/admin2/dash" />
    </Switch>
);

export default function MiniDrawer(props) {
    const classes = useStyles();
    const theme = useTheme();
    const [open, setOpen] = React.useState(false);

    const handleDrawerOpen = () => {
        setOpen(true);
    };

    const handleDrawerClose = () => {
        setOpen(false);
    };

    return (
        <div className={classes.root}>
            <CssBaseline />
            <AppBar
                position="fixed"
                color='colorPrimary'
                className={clsx(classes.appBar, {
                    [classes.appBarShift]: open,
                })}
            >
                <Toolbar>
                    <IconButton
                        color="inherit"
                        aria-label="open drawer"
                        onClick={handleDrawerOpen}
                        edge="start"
                        className={clsx(classes.menuButton, {
                            [classes.hide]: open,
                        })}
                    >
                        <MenuIcon />
                    </IconButton>
                    <Typography variant="h6" noWrap>
                        Dash Board
                     </Typography>
                </Toolbar>
                <NavbarLinks />
            </AppBar>
            <Drawer
                variant="permanent"
                className={clsx(classes.drawer, {
                    [classes.drawerOpen]: open,
                    [classes.drawerClose]: !open,
                })}
                classes={{
                    paper: clsx({
                        [classes.drawerOpen]: open,
                        [classes.drawerClose]: !open,
                    }),
                }}
            >
                <div className={classes.toolbar}>
                    <IconButton onClick={handleDrawerClose}>
                        {theme.direction === 'rtl' ? <ChevronRightIcon /> : <ChevronLeftIcon />}
                    </IconButton>
                </div>
                <Divider />
                <List>
                    <List className={classes.list}>
                        {routes.map((prop, key) => {

                            var listItemClasses;


                            listItemClasses = classNames({
                                [" " + classes[color]]: activeRoute(prop.layout + prop.path)
                            });

                            const whiteFontClasses = classNames({
                                [" " + classes.whiteFont]: activeRoute(prop.layout + prop.path)
                            });
                            return (
                                <NavLink
                                    to={prop.layout + prop.path}
                                    className={activePro + classes.item}
                                    activeClassName="active"
                                    key={key}
                                >
                                    <ListItem button className={classes.itemLink + listItemClasses}>
                                        {typeof prop.icon === "string" ? (
                                            <Icon
                                                className={classNames(classes.itemIcon, whiteFontClasses, {
                                                    [classes.itemIconRTL]: props.rtlActive
                                                })}
                                            >
                                                {prop.icon}
                                            </Icon>
                                        ) : (
                                                <prop.icon
                                                    className={classNames(classes.itemIcon, whiteFontClasses, {
                                                        [classes.itemIconRTL]: props.rtlActive
                                                    })}
                                                />
                                            )}
                                        <ListItemText
                                            primary={props.rtlActive ? prop.rtlName : prop.name}
                                            className={classNames(classes.itemText, whiteFontClasses, {
                                                [classes.itemTextRTL]: props.rtlActive
                                            })}
                                            disableTypography={false}//era true
                                        />
                                    </ListItem>
                                </NavLink>
                            );
                        })}
                    </List>

                </List>
                <Divider />
                <List>
                    {['All mail', 'Trash', 'Spam'].map((text, index) => (
                        <ListItem button key={text}>
                            <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon>
                            <ListItemText primary={text} />
                        </ListItem>
                    ))}
                </List>
            </Drawer>
            {getRoute() ? (
                <div className={classes.content}>
                    <div className={classes.toolbar} />
                    <div className={classes.container}>{switchRoutes}</div>
                </div>
            ) : (
                    <div className={classes.map}>{switchRoutes}</div>
                )}
        </div>
    );
}
